export default [
  {
    path: '/modulo-a',
    component: () => import('@/Usuario/views/Main.vue'),
    children: [
      {
        path: '/',
        redirect: 'inicio'
      },
      {
        path: 'inicio',
        name: 'inicio-a',
        components: {
          Usuario: () => import('@/Usuario/views/Inicio.vue')
        }
      },
      {
        path: 'composicion',
        name: 'composicion',
        components: {
          Usuario: () => import('@/Usuario/views/Composicion.vue')
        },
        meta: {
          auth: true
        }
      },
      {
        path: 'composiciones',
        name: 'composiciones',
        components: {
          Usuario: () => import('@/Usuario/views/Composiciones.vue')
        },
        meta: {
          auth: true
        }
      },
      {
        path: 'servicios',
        name: 'servicios',
        components: {
          Usuario: () => import('@/Usuario/views/Servicios.vue')
        },
        meta: {
          auth: true
        }
      },
      {
        path: 'perfil',
        name: 'perfil',
        components: {
          Usuario: () => import('@/Usuario/views/Perfil.vue')
        },
        meta: {
          auth: true
        }
      }
    ]
  }
]
